import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';
import './Help.css';

function Help() {
  return (
    <div className="help">
      <Header />
      <main>
        <h1>Help Center</h1>
        <p>Get support for your StreamFlix account and streaming issues.</p>
      </main>
      <Footer />
    </div>
  );
}

export default Help;
